[{"location":"reference/#Reference","page":"Reference","title":"Reference","text":"","category":"section"},{"location":"reference/","page":"Reference","title":"Reference","text":"This is the public API for DataToolkit. Some symbols have been exported for convenience, others need to be specifically imported or accessed with DataToolkit.<thing>.","category":"page"},{"location":"reference/#Exported-Symbols","page":"Reference","title":"Exported Symbols","text":"","category":"section"},{"location":"reference/#Macros","page":"Reference","title":"Macros","text":"","category":"section"},{"location":"reference/#DataToolkit","page":"Reference","title":"DataToolkit","text":"","category":"section"},{"location":"reference/","page":"Reference","title":"Reference","text":"@d_str","category":"page"},{"location":"reference/#DataToolkit.@d_str","page":"Reference","title":"DataToolkit.@d_str","text":"@d_str -> loaded data\n\nShorthand for loading a dataset in the default format, d\"iris\" is equivalent to read(dataset(\"iris\")).\n\n\n\n\n\n","category":"macro"},{"location":"reference/","page":"Reference","title":"Reference","text":"@data_cmd","category":"page"},{"location":"reference/#DataToolkit.@data_cmd","page":"Reference","title":"DataToolkit.@data_cmd","text":"@data_cmd -> Data REPL command result\n\nProxy for running the command in the Data REPL, e.g. data`config set demo 1` is equivalent to data> config set demo 1.\n\n\n\n\n\n","category":"macro"},{"location":"reference/#DataToolkitBase","page":"Reference","title":"DataToolkitBase","text":"","category":"section"},{"location":"reference/","page":"Reference","title":"Reference","text":"@import","category":"page"},{"location":"reference/#Functions","page":"Reference","title":"Functions","text":"","category":"section"},{"location":"reference/#DataToolkitBase-2","page":"Reference","title":"DataToolkitBase","text":"","category":"section"},{"location":"reference/","page":"Reference","title":"Reference","text":"dataset","category":"page"},{"location":"reference/","page":"Reference","title":"Reference","text":"loadcollection!","category":"page"},{"location":"reference/#Types","page":"Reference","title":"Types","text":"","category":"section"},{"location":"reference/#DataToolkitBase-3","page":"Reference","title":"DataToolkitBase","text":"","category":"section"},{"location":"reference/","page":"Reference","title":"Reference","text":"DataSet","category":"page"},{"location":"reference/#Unexported-Symbols","page":"Reference","title":"Unexported Symbols","text":"","category":"section"},{"location":"reference/#Modules","page":"Reference","title":"Modules","text":"","category":"section"},{"location":"reference/","page":"Reference","title":"Reference","text":"DataToolkitBase and DataToolkitCommon are available as Base and Common respectively.","category":"page"},{"location":"reference/#Macros-2","page":"Reference","title":"Macros","text":"","category":"section"},{"location":"reference/#DataToolkit-2","page":"Reference","title":"DataToolkit","text":"","category":"section"},{"location":"reference/","page":"Reference","title":"Reference","text":"DataToolkit.@addpkgs","category":"page"},{"location":"reference/#DataToolkit.@addpkgs","page":"Reference","title":"DataToolkit.@addpkgs","text":"@addpkgs pkgs...\n\nFor each named package, register it with DataToolkitBase. Each package must be a dependency of the current module, recorded in its Project.toml.\n\nThis allows the packages to be used with DataToolkitBase.@import.\n\nInstead of providing a list of packages, the symbol * can be provided to register all dependencies.\n\nThis must be run at runtime to take effect, so be sure to place it in the __init__ function of a package.\n\nExamples\n\n@addpkgs JSON3 CSV\n@addpkgs * # Register all dependencies\n\n\n\n\n\n","category":"macro"},{"location":"reference/","page":"Reference","title":"Reference","text":"DataToolkit.@addpkg","category":"page"},{"location":"reference/#Functions-2","page":"Reference","title":"Functions","text":"","category":"section"},{"location":"reference/#DataToolkit-3","page":"Reference","title":"DataToolkit","text":"","category":"section"},{"location":"reference/","page":"Reference","title":"Reference","text":"DataToolkit.init","category":"page"},{"location":"reference/#DataToolkit.init","page":"Reference","title":"DataToolkit.init","text":"init(mod::Module=Main; force::Bool=false)\n\nLoad the mod-local Data.toml if it exists. When mod is Main, every Data.toml on the load path is loaded. Unless force is set, the data collection is soft-loaded.\n\nA Data.d directory can be used in place of a Data.toml, in which case every toml file within it will be read. Mixing Data.d/*.toml and Data.toml is discouraged.\n\n\n\n\n\n","category":"function"},{"location":"reference/","page":"Reference","title":"Reference","text":"DataToolkit.plugins","category":"page"},{"location":"reference/#DataToolkit.plugins","page":"Reference","title":"DataToolkit.plugins","text":"plugins()\n\nList the currently availible plugins, by name.\n\n\n\n\n\n","category":"function"},{"location":"reference/","page":"Reference","title":"Reference","text":"DataToolkit.addpkgs","category":"page"},{"location":"reference/#DataToolkit.addpkgs","page":"Reference","title":"DataToolkit.addpkgs","text":"addpkgs(mod::Module, pkgs::Vector{Symbol})\n\nFor each package in pkgs, which are dependencies recorded in mod's Project.toml, register the package with DataToolkitBase.addpkg.\n\nIf pkgs consists of the single symbol :*, then all dependencies of mod will be registered.\n\nThis must be run at runtime to take effect, so be sure to place it in the __init__ function of a package.\n\n\n\n\n\n","category":"function"},{"location":"reference/#DataToolkitBase-4","page":"Reference","title":"DataToolkitBase","text":"","category":"section"},{"location":"reference/","page":"Reference","title":"Reference","text":"DataToolkit.getlayer","category":"page"},{"location":"reference/#Types-2","page":"Reference","title":"Types","text":"","category":"section"},{"location":"reference/#DataToolkitBase-5","page":"Reference","title":"DataToolkitBase","text":"","category":"section"},{"location":"reference/","page":"Reference","title":"Reference","text":"DataToolkit.DataCollection","category":"page"},{"location":"reference/","page":"Reference","title":"Reference","text":"DataToolkit.DataSet","category":"page"},{"location":"reference/","page":"Reference","title":"Reference","text":"DataToolkit.DataStorage","category":"page"},{"location":"reference/","page":"Reference","title":"Reference","text":"DataToolkit.DataLoader","category":"page"},{"location":"reference/","page":"Reference","title":"Reference","text":"DataToolkit.DataWriter","category":"page"},{"location":"reference/","page":"Reference","title":"Reference","text":"DataToolkit.Identifier","category":"page"},{"location":"reference/","page":"Reference","title":"Reference","text":"DataToolkit.Plugin","category":"page"},{"location":"#Introduction","page":"Introduction","title":"Introduction","text":"","category":"section"},{"location":"","page":"Introduction","title":"Introduction","text":"DataToolkit bundles DataToolkitBase and DataToolkitCommon, and provides a very thin convenience layer on top.","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"For details on the fundamental system, see the DataToolkitBase docs; for details on the transformers and plugins available see the DataToolkitCommon docs.","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"In future, this documentation will be expanded with a \"quickstart guide\" among other things. The current form is basically a stub.","category":"page"}]
